import React, { Component } from 'react';
import "../styles/charadata.css"
class Characterdata extends Component {
  closeCustomModal = (e) => {
    this.props.onCloseModal(e);
  };
  render() {
    const { id, className, header, body, footer } = this.props;
    return (
      <div id="myModal" className="modal">
        <div className="modal-content">
          <div className="modal-header">
            <span className="close" onClick={this.closeCustomModal}>
              &times;
            </span>
            <h4>Character Data</h4>
          </div>

          <div className="modal-body">
          <form>
            <label>Enter your name:
              <input type="text" />
            </label>
            <label for="vision">Choose a car:</label>
              <select id="vis" name="element">
                <option value="Anemo">Volvo</option>
                <option value="Geo">Saab</option>
                <option value="Electro">Fiat</option>
                <option value="Dendro">Audi</option>
                <option value="Cryo">Fiat</option>
                <option value="Pyro">Audi</option>
                <option value="Hydro">Audi</option>
              </select>
          </form>
          </div>
        </div>
      </div>
    );
  }
}

export default Characterdata;
